import { Link, Route, Routes } from "react-router-dom"
import Experience from "../Tabs-pro/Experience"

function RoutPrac(){
    return (
        <div>
            <Link to='/junaid'>Link activate after click</Link>
            <Routes>
                <Route path="/junaid" element={<Experience/>}/>
            </Routes>
        </div>
    )
}
export default RoutPrac
